import styled from 'styled-components';
import theme from '../../styles/theme';

export const Container = styled.div`
  margin: 50px 0px;
  ::before, ::after {
    content: '';
    display: block;
    width: 100%;
    height: 5px;
    background-color: ${theme.colors.primary};
  }
`;
